import { Component, OnInit, Input, Output, EventEmitter } from '@angular/core';
import { Router } from '@angular/router';
import { Player } from '../types';

@Component({
  selector: 'app-player-data-form',
  templateUrl: './player-data-form.component.html',
  styleUrls: ['./player-data-form.component.css']
})
export class PlayerDataFormComponent implements OnInit{
  @Input() buttonText;
  @Input() currentFName = '';
  @Input() currentLName = '';
  @Input() currentGamertag = '';
  @Input() currentPlatform = '';
  @Input() currentAge = '';

  firstName: string = '';
  lastName: string = '';
  gamertag: string = '';
  platform: string = '';
  age: number = 0;
  regionID: number = 0;

  @Output() onSubmit = new EventEmitter<Player>();

  constructor(
    private router: Router,
    private leaderboardService: LeaderboardService,
  ) { }

  ngOnInit(): void {
  }

  onButtonClicked(): void {
    this.onSubmit.emit({
      firstName: this.firstName,
      lastName: this.lastName,
      gamertag: this.gamertag,
      platform: this.platform,
      age: Number(this.age),
      regionID: Number(this.regionID),
    });
  }
}
